import { IonCol, IonContent, IonGrid, IonImg, IonPage, IonRouterLink, IonRow, IonSlide, IonSlides, IonText } from '@ionic/react';
import React from 'react';

import '../css/Global.css';
import '../css/UsefulInfo.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFileAlt } from '@fortawesome/free-solid-svg-icons';

import blkA from '../img/campusFacilities/blkA.png';
import blkB from '../img/campusFacilities/blkB.png';
import blkC from '../img/campusFacilities/blkC.png';
import blkD from '../img/campusFacilities/blkD.png';

import TopNav from '../components/TopNav';
import Menu from '../components/Menu';


const UsefulInfoMain: React.FC = () => {

    return (
        <IonPage>
            <TopNav title="Campus Facilities Map" route='/u/home' backarrow={ true } hamburger = { true }/>

            <IonContent fullscreen={true}>
                <IonGrid className="usefulInfoIonContent">
                    <IonRow className="ion-justify-content-around mainRow">
                        <IonCol size-sizeSm="6" className="mainCol">
                            <IonRouterLink routerLink="/u/usefulInfoMain/">
                                <IonRow className="ion-justify-content-center">
                                    <FontAwesomeIcon className="usefulInfoIcons" size="2x" icon={faFileAlt} />
                                </IonRow>

                                <IonRow className="ion-justify-content-center">
                                    <IonText className="usefulInfoText">Open House Programmes</IonText>
                                </IonRow>
                            </IonRouterLink>
                        </IonCol>
                    </IonRow>


                </IonGrid>
            </IonContent>
        </IonPage>
    );
};

export default UsefulInfoMain;
